import React from "react";

function handleClick(props) {
  props.onDelete(props.id);
}

function Note(props) {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content};</p>
      <button onClick={handleClick}>Delete</button>
    </div>
  );
}

export default Note;
